import React from 'react';
import Button from '@material-ui/core/Button';

const ActionButton = (submitText = '', link = '', target = '_blank') => {
    return (
        <div>
            <Button variant="contained" color="primary">{submitText}</Button>
        </div>
    )
}

export default ActionButton
